  return (
    <div>
      <BrowserRouter history={history}>
        <div>
          <Switch>
            <Route exact path="/"  component={MainPage} />
            <Route exact path="/qacards"  component={QuestionAnswerCard} />
            <Route exact path="/qacards/score"  component={ScoreBoard} />
          </Switch>
        </div>
      </BrowserRouter>
    </div>
  );
};

export default App;
